import React from "react";
import {
    Container
} from "@material-ui/core";
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import Link from '@material-ui/core/Link';

function Copyright() {
    return (<
        Typography variant="body2"
        color="textSecondary"
        align="center" > {
            'Copyright © '
        } <
        Link color="inherit"
            href="https://material-ui.com/" >
            Your Website <
        /Link>{' '} {
                new Date().getFullYear()
            } {
                '.'
            } <
        /Typography>
    );
}
const ResetPassword = () => ( <
    Container >
                <
    div >
                    <
    h2 > ResetPassword < /h2> <
    /div> <
    blockquote class="wp-block-quote" > < p > Ein Buch über einen Mann, der als amerikanischer Soldat bei der Schlacht in Dresden am Ende des zweiten Weltkriegs dabei war.Die Psyche des Mannes ist davon nicht unerschüttert geblieben.So glaubt er im Kontakt mit Außerirdischen zu stehen und das ist für ihn vollkommen normal.Es finden oft Zeitsprünge im Buch statt zwischen Vergangenheit und Zukunft, der Erde und dem Planeten Tralfamadore.Die Art und Weise, wie Vonnegut schreibt hat mich sehr beeindruckt.Er bringt das zu Papier, was auch dahin gehört.So geht das. < /p></blockquote >
                            <
    Box pt={
                                    4
                                } >
                                <
                                    Copyright />
                                <
    /Box> <
    /Container>
);

export default ResetPassword;
